import React from 'react';

function Home() {
    const openLoginWindow = () => {
        window.open('/login', '_blank', 'width=600,height=400');
    };

    const openRegistrationWindow = () => {
        window.open('/registration', '_blank', 'width=600,height=400');
    };

    return (
        <div>
            <h1>Добро пожаловать!</h1>
            <button onClick={openLoginWindow}>Вход</button>
            <button onClick={openRegistrationWindow}>Регистрация</button>
        </div>
    );
}

export default Home;
